import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { NavLink } from 'react-router-dom';
import { FiMenu } from 'react-icons/fi';

export default function Adminpanel() {

  return (
    <>
      <div  style={{ margin: "100px" }}>

      <Navbar  expand="lg" fixed="top"   >
      <Container>


      <Navbar.Toggle aria-controls="basic-navbar-nav" />

      <Navbar.Collapse id="basic-navbar-nav" className="navbar-admin-left">
          <Nav className="me-auto">
          <nav>
      <div className="menu-icon">
          <FiMenu />
        </div>

          <div className="menu-items-admin">
          <div className="text-center">
      <img src="/images/person.png" alt="" width={"45"} height={"45"} />
<p className='menu-items-admin-link'>Deniz Şenocak</p>   {/*  be'den gelcek*/}
<p className='menu-items-admin-link'>exapmle@gmail.com</p>  {/*  be'den gelcek*/} 
      </div>
            <NavLink className="menu-items-admin-link" to='/Adminarama'>Admin Arama Sayfası</NavLink>
            <hr/>
            <NavLink className="menu-items-admin-link" to='/Adminstokkontrol'>Admin Stok Kontrol Sayfası</NavLink>
            <hr/>
            <NavLink className="menu-items-admin-link" to='/Stokeklecikar'>Stok Ekle/Çıkar</NavLink>
            <hr/>
            <NavLink className="menu-items-admin-link" to='/Blogdetay'>Blog Detay</NavLink>   
            <hr/>

          </div>

      </nav>
          </Nav>
        </Navbar.Collapse>



      </Container>
      </Navbar>
      </div>
    </>
  );
}
